import X3Matrix from "./X3matrix";

const X3MatrixHolder = () => {
  const elements = [];
  for (let i = 1; i < 13; i++) {
    elements.push({
      id: i,
    });
  }

  const people = [];

  for (let i = 0; i < 10; i++) {
    people.push({
      name: chance.first(),
      country: chance.country({ full: true }),
    });
  }

  return (
    <>
      <div className="upper-holder">
        <div className="top-part">
          <h1>Forsage x3</h1>
        </div>
        <div className="bottom-part">
          {elements.map((matrix, id) => (
            <X3Matrix id={id} />
          ))}
        </div>
        <div>
          {this.state.people.map((person, index) => (
            <p>
              Hello, {person.name} from {person.country}!
            </p>
          ))}
        </div>
        <p>Hallo ich bin der Lückenfüller Text für die Icones</p>
      </div>
      <style jsx>{`
        .upper-holder {
          margin-bottom: 20px;
          text-align: left;
        }
        .top-part {
          width: 100%;
          background: rgba(28, 22, 85, 1);
          border-radius: 20px 20px 0 0;
          padding: 10px 20px;
        }
        .bottom-part {
          width: 100%;
          background: rgba(28, 22, 85, 1);
          border-radius: 0 0 20px 20px;
          padding: 10px 20px;
          border-top: 2px solid black;
          display: grid;
          grid-template-columns: repeat(auto-fit, minmax(150px, 1fr));
          grid-gap: 50px;
        }
      `}</style>
    </>
  );
};
export default X3MatrixHolder;
